const i=JSON.parse('{"key":"v-5cf58b05","path":"/en/train/eda/chip-circuit/Part_1-chip_basic/1_1_chip_types.html","title":"1.1 芯片类型","lang":"en-US","frontmatter":{"title":"1.1 芯片类型","order":1},"headers":[{"level":2,"title":"1 芯片的“通用”与“专用”","slug":"_1-芯片的-通用-与-专用","link":"#_1-芯片的-通用-与-专用","children":[]},{"level":2,"title":"2 ASIC 的全定制、半定制和可编程","slug":"_2-asic-的全定制、半定制和可编程","link":"#_2-asic-的全定制、半定制和可编程","children":[]},{"level":2,"title":"3 芯片的结构层级","slug":"_3-芯片的结构层级","link":"#_3-芯片的结构层级","children":[]},{"level":2,"title":"4 SoC、MPU、MCU、CPU、GPU、DSP 简介","slug":"_4-soc、mpu、mcu、cpu、gpu、dsp-简介","link":"#_4-soc、mpu、mcu、cpu、gpu、dsp-简介","children":[]},{"level":2,"title":"5 ASIC vs VLSI","slug":"_5-asic-vs-vlsi","link":"#_5-asic-vs-vlsi","children":[]},{"level":2,"title":"6 引用","slug":"_6-引用","link":"#_6-引用","children":[]}],"git":{"createdTime":1723131714000,"updatedTime":1723131714000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":11.72,"words":3515},"filePathRelative":"en/train/eda/chip-circuit/Part_1-chip_basic/1_1_chip_types.md","localizedDate":"August 8, 2024","excerpt":"<p>想必大家都挺说过IC、ASIC、VLSI、FPGA等等专业术语，也听说过芯片前端、后端、设计、制作等等流程，但对其了解比较少，接下来我们将从这些术语定义出发，逐个解开芯片领域<strong>术语</strong>的面纱，理清芯片设计的<strong>内部结构</strong>。</p>\\n<h2> 1 芯片的“通用”与“专用”</h2>\\n<p>IC 全称为 integrated circuit，意为<strong>集成电路</strong>。它就是 <strong>芯片(chip)</strong> 的另一个专业别称。</p>\\n<p>集成电路按照用途可以分成两大类，一是<strong>通用芯片</strong>，包括经常听到的CPU、 GPU、 DSP等；二是<strong>专用芯片</strong>，包括FPGA、ASIC等。这个大类划分很重要，两者有本质上的不同。需要说明下，芯片的分类有很多种，我们这样的分类是基于芯片的设计理念，这是后续理解一切的基础。</p>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{i as data};
